import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import AllPropertiesPage from './pages/AllPropertiesPage';
import ChaletDetailPage from './pages/ChaletDetailPage';
import Footer from './components/Footer';


const RentPage = () => <div>Rent Chalets Page</div>;
const LoginPage = () => <div>Login/Sign Up Page</div>;

function App() {
  return (
    <Router>
      <div className="App">
        <main>
          <Routes>
            <Route path="/" element={<Home scrollTo="hero" />} />
            <Route path="/home" element={<Home scrollTo="hero" />} />
            <Route path="/properties" element={<AllPropertiesPage />} />
